import React, {Component, Fragment} from 'react';
import BoardSquare from "./BoardSquare";


class Board extends Component {
    renderSquare = (value, index) => {
        return (
            <BoardSquare />
        )
    };

    render() {
        return (
            <div className='board'>
                {this.props.board.map( e => (
                    {renderSquare}
                ))}
            </div>
        );
    }
}



export default Board;
